import React from 'react'

class Main extends React.Component{
    render(){
        return(
            <div className='Main'>
                <div className='MainNav'>
                    <h1>Name</h1>
                    <h1>Street</h1>
                    <h1>City</h1>
                    <h1>Email</h1>
                </div>
                <div className='MainContent'>
                    {this.props.content.map(item=>{
                        <>
                        <h1>{item.name}</h1>
                        </>
                    })}
                </div>
            </div>
        )
    }
}

export default Main
